<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Екатерина Яковлевна Голубева родится восемнадцатого сентября 2549. <br><p>Тридцать первого октября 2043 устроится на работу в Фонд на должность рефлексотерапевта. </p><p>	Окончательно уволится семнадцатого апреля 2853. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
